Entry.block.CODEino_get_accelerometer_direction = function(c, b) {
  c = b.getField("DIRECTION", b);
  b = 0;
  "LEFT" == c || "RIGHT" == c ? b = 3 : "FRONT" == c || "REAR" == c ? b = 4 : "REVERSE" == c && (b = 5);
  b = Entry.hw.getAnalogPortValue(b) - 265;
  b = Math.min(90, 180 / 137 * b + -90);
  b = Math.max(-90, b);
  b = Math.round(b);
  if ("LEFT" == c || "REAR" == c) {
    return -30 > b ? 1 : 0;
  }
  if ("RIGHT" == c || "FRONT" == c) {
    return 30 < b ? 1 : 0;
  }
  if ("REVERSE" == c) {
    return -50 > b ? 1 : 0;
  }
};
