Entry.block.CODEino_get_accelerometer_value = function(c, b) {
  var d = Entry.hw.getAnalogPortValue(b.getField("PORT", b)), e = 265, f = 402;
  c = -90;
  b = 90;
  if (e > f) {
    var g = e, e = f, f = g;
  }
  c > b && (g = c, c = b, b = g);
  d = (b - c) / (f - e) * (d - e);
  d += c;
  d = Math.min(b, d);
  d = Math.max(c, d);
  return Math.round(d);
};
